import React from 'react';


const ImageList = (props) => {
    console.log(props.images)
    const images=props.images.map(image=>{
        return(
            <img alt={image.description} key={image.id} src={image.urls.regular}/>
        )
    })
    return (
        <div>{images}</div>
    )
}

export default ImageList;
